import React from 'react';
import PieChart from 'react-minimal-pie-chart';
import './CycleGraph.css';


let terminated=0;
let compeleted=0;
let failed=0;
let timouted=0;

class CycleGraph extends React.Component {
    render() {
         for(let i;i<this.props.data;i++){
             terminated+= this.props.data.Ex_Terminated;
             
         }




        return (
            <div className="ui container">
                <PieChart data={[
                    {
                        title: 'Terminated',
                        value: 10,
                        color: '#e3c877'
                    },
                    {
                        title: 'Completed',
                        value: 15,
                        color: '#45c176'
                    },
                    {
                        title: 'Failed',
                        value: 20,
                        color: '#b02d2c',

                    },
                    {
                        title: 'Timeout',
                        value: 20,
                        color: '#55b8cc',
                    }
                ]}

                          lineWidth={30}
                          paddingAngle={5}
                          lengthAngle={-360}
                          style={{height: '200px'}}

                          label={({ data, dataIndex }) =>
                              Math.round(data[dataIndex].percentage) + '%'
                          }
                          labelStyle={{
                              fontSize: '5px',
                              fontFamily: 'sans-serif'}}
                          labelPosition={60}
                          animate


                />
                <div className="containerTitles">
                    <div><span className="dot yellow"/>Terminated</div>
                    <div><span className="dot green"/>Completed</div>
                    <div><span className="dot red"/>Failed</div>
                    <div><span className="dot blue"/>Timeout</div>
                </div>
            </div>
        );
    }
}

export default CycleGraph;
